import React from 'react';
import styled from 'styled-components';

const HomeListingCard = () => {
  const HomeCardStyle = styled.div`
  color: red
`
  return (
      <HomeCardStyle>
        <div>Home Listing Card</div>
      </HomeCardStyle>
  )
};

export default HomeListingCard;
